import React from 'react';
import Link from 'next/link'
const NavBar = () => {
    return (
        <div>
            <nav>
                <menu>
                    <Link href="/">
                    <a >Home</a>

                    </Link>

                    <Link href="/">
                        <a >Home</a>

                    <a href="/about">About</a>
                    </Link>
                </menu>
            </nav>
        </div>
    );
};

export default NavBar;
